import React, { useState } from 'react';

const PublicSets = () => {
    const [sets, setSets] = useState()
    // on load, get all public sets?
    return (
        <>
        {sets ? 
             sets.map(s => s.name)
            : <h1>Loading...</h1>}
        </>
    )
}

export default PublicSets;
